import React, { Component } from "react";

class DETALLES extends Component {
  render() {
    const { carro } = this.props;
    console.log(carro);
    return (
      <div className="detalles">
        {carro.map((el) => (
          <li key={el.name}>
              <span>{}</span>
            <img className="img-carro" alt={el.name} src={el.img}></img>
          </li>
        ))}
      </div>
    );
  }
}

export default DETALLES;
